System packages are the only places where you can define functions that have side effects. Thanks to system packages, applications can perform effects to interact with the world, such as: Console input/output File system operations Networking Random number generation Note that system packages should never expose side effects directly through their functions ; all public functions in system packages must be purely functional. Instead, you need to pass a Context type to every effect-ful function for it to make side effects. For example, a system package for command line applications might have the following types and functions: # Define a foreign function to output a string in console.
import foreign _pen_cli_print \(string) none type Context { print: _pen_cli_print,
} Print = \(ctx Context, s string) none { ctx.print(s)
} rather than: import foreign _pen_cli_print \(string) none Print = \(s string) none { # Oh, no! We make side effects in a public function directly. _pen_cli_print(s)
}

